import styled from 'styled-components'

export const StyledButton = styled.button`
	cursor: pointer;
	margin-left: 80%;
	margin: 0 ;
`
export const StyledContent = styled.div`
	height: 26rem;
	width: 100%;
	display: flex;
	justify-content: space-between;
	margin: 2rem 2rem;


	`
